import React, { useState, useEffect } from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';

export default function FoodDeliveryHome() {





  var content = listContent;
  if (selectedDuoSession != null) {
    content = duoSessionContent;
  }

  return (
    <React.Fragment>
    <CssBaseline />
    <Container maxWidth="md">
      <Grid container>
        <Grid item xs={12}>
          <Typography variant="h4" component="h2" gutterBottom>
            Create Duo Session:
          </Typography>
        </Grid>
        <Grid item xs={4}>
          <Grid container justify="center">
            <Autocomplete
              id="combo-box-coach"
              options={employees}
              getOptionLabel={(option) => option.userName}
              style={{ width: 300 }}
              onInputChange={handleCoachChange}
              renderInput={(params) => <TextField {...params} label="Coach" variant="outlined" />}
            />
          </Grid>
        </Grid>
        <Grid item xs={4}>
          <Grid container justify="center">
            <Autocomplete
              id="combo-box-employee"
              options={employees}
              getOptionLabel={(option) => option.userName}
              style={{ width: 300 }}
              onInputChange={handleEmployeeChange}
              renderInput={(params) => <TextField {...params} label="Employee" variant="outlined" />}
            />
          </Grid>
        </Grid>
        <Grid item xs={4}>
          <Grid container justify="center">
            <Button variant="contained" color="primary" onClick={startDuoSession} size="large">
              Start Duo Session
            </Button>
          </Grid>
        </Grid>
      </Grid>
    </Container>
  </React.Fragment>
  );
}
